INSERT INTO `profile` VALUES (1,'A la suite d’études en physique, j’ai décidé de me reconvertir grâce à l’excellent bootcamp de la Wild Code School, dans un milieu que j’affectionne tout particulièrement:  le développement web.\nJ’aimerai devenir full-stack afin de mettre mes services à disposition de futurs clients.','fdca3fda-82b0-4f81-8025-fb61928193a8','https://github.com/mounir-mk','https://www.linkedin.com/in/mounir-mekoui/');
