INSERT INTO `project` VALUES (1,'2023-02-04 12:55:16','2023-02-04 14:03:54','Project 1 (WCS)','Le premier projet réalisé au sein de la Wild Code School.\nCe projet consiste en la réalisation d’un simple site statique décrivant le programme du bootcamp au travers d’une Timeline et a été réalisé en HTML, CSS et JS.','7e5071c7-81c0-43f8-aa1b-fd857dd8b25d','https://github.com/Mounir-mk/Project-1'),(2,'2023-02-04 13:08:55','2023-02-04 14:04:12','Projet 2 (WCS)','Le deuxième projet a été réalisé en utilisant react et une API externe. \nIl s’agit d’un simple jeu de cartes où deux joueurs construisent un deck et font combattre leurs cartes en fonction de leurs statistiques.','b9d81450-8da4-40e3-a2e9-582c5fa20eaf','https://github.com/Mounir-mk/Legends'),(3,'2023-02-04 14:15:47',NULL,'Projet 3 (WCS)','Il s\'agit ici d\'un projet full-stack réalisé dans le cadre d\'un partenariat avec l\'entreprise MakeSense. Celui-ci a consisté en la réalisation d\'une plateforme d\'idéations de prises de décisions pour ses employées ainsi que pour des potentiels intervenants extérieurs. L\'aspect technique de ce projet nous a, mon équipe et moi fait énormément progressé malgré les problèmes rencontrés.','fb11cb1e-4d43-4260-825b-bb2cf7e35fc6','https://github.com/WildCodeSchool/2022-09-JS-Reims-project-3-make-sense');
/*!40000 ALTER TABLE `project` ENABLE KEYS */;
UNLOCK TABLES;

